// src/pages/DoctorList.jsx
import { useEffect, useState } from "react";

const DoctorList = () => {
  console.log("DoctorList rendered"); // ðŸ‘ˆ Debug log

  const [doctors, setDoctors] = useState([]);
  const [error, setError] = useState("");

  useEffect(() => {
    const fetchDoctors = async () => {
      const token = localStorage.getItem("token");
      if (!token) {
        setError("Not authorized");
        return;
      }

      try {
        const res = await fetch("https://ahd.instapract.ae/web/api/doctor/doc-list", {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });

        const data = await res.json();
        console.log("Doctor list response:", data); // ðŸ‘ˆ API response log

        if (res.ok) {
          setDoctors(data.data || []);
        } else {
          setError(data.message || "Failed to fetch doctor list.");
        }
      } catch (err) {
        setError("Error fetching doctors");
      }
    };

    fetchDoctors();
  }, []);

  return (
    <div className="p-4">
      <h2 className="text-xl font-bold mb-4">Doctor List</h2>
      {error && <p className="text-red-500 mb-4">{error}</p>}
      <ul className="list-disc pl-4">
        {doctors.map((doc, index) => (
          <li key={index}>{doc.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default DoctorList;
